import React from 'react';

import classes from './shoeMenuSmall.module.css';

function ShoeMenuSmall(props){
    return(
        <>
            <li className={classes.smallMenu}>
                <div>Men</div>
                <div>></div>
                <div className={classes.subHead}>
                    hello
                </div>
            </li>
            <li className={classes.smallMenu}>
                <div>Women</div>
                <div>></div>
            </li>
            <li className={classes.smallMenu}>
                <div>Kids</div>
                <div>></div>
            </li>
        </>
    );
}

export default ShoeMenuSmall;
